import useScrollTrigger from '@material-ui/core/useScrollTrigger';
import SlideIn from 'material-ui/internal/SlideIn';

class Header extends React.Component {


  render() {
    return (
      <SlideIn in={!trigger}>
        This is Header.
      </SlideIn>
    );
  }

}

export default Header;
